import logo from './logo.svg';
import './App.css';
import {MainApp} from './components/MainAppComponent'
import {Nav} from './components/NavComponent/Nav'
import { BrowserRouter as Router, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <MainApp/>
      <Router>
        <Route path="/users">
          <Home/>
        </Route>
      </Router>
    </div>
  );
}

export default App;
